import React, { useState, useEffect } from "react";
import ReactDOM from "react-dom";
import { Row, Col, Container } from "react-bootstrap";
import { NavbarComp, ListKategori, Hasil } from "./component/index";
import { API_URL } from "./utils/constants";
import axios from "axios";

const App = () => {
	const [menu, setMenu] = useState();

	useEffect(() => {
		axios
			.get(API_URL + "products")
			.then((response) => {
				// handle success
				setMenu(response.data);
			})
			.catch((error) => {
				// handle error
				console.log(error);
			});
	}, []);

	return (
		<>
			<div className="App">
				<NavbarComp />
				<div className="mt-3">
					<Container fluid>
						<Row>
							<ListKategori />
							<Col>
								<h4>
									<strong>Daftar Produk</strong>
								</h4>
								<hr />
							</Col>
							<Hasil />
						</Row>
					</Container>
				</div>
			</div>
			<h1>{menu}</h1>
		</>
	);
};

export default App;
